"use strict";export default function Vector(t,n){const r=Math.sqrt(t*t+n*n);function e(r){return Vector(t-r.x,n-r.y)}function o(r){return Vector(t*r.height>>0,n*r.height>>0)}return{x:t,y:n,normalized:function(){return Vector(t/r,n/r)},mag:function(){return r},angle:function(){return-Math.atan2(n,t)},distantTo:function(t){return e(t).mag()},plus:function(r){return Vector(t+r.x,n+r.y)},minus:e,mult:function(r){return Vector(t*r,n*r)},div:function(r){return Vector(t/r,n/r)},dot:function(r){return t*r.x+n*r.y},angleTo:function(r){return Math.atan2(r.y,r.x)-Math.atan2(n,t)},parallel:function(r){return t/r.x>0&&(t/r.x).toFixed(8)===(n/r.y).toFixed(8)},equal:function(r){return t.toFixed(8)===r.x.toFixed(8)&&n.toFixed(8)===r.y.toFixed(8)},rotate:function(r){const e=Math.sin(r),o=Math.cos(r);return Vector(o*t-e*n,e*t+o*n)},toWorld:o}}